insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">大好きなケーキ屋さん2店舗<br><br>以前から大ファンで<br>特にチョコレートケーキは東京トップ(ぼく調べ)だと思っているのですが、ともに手に入れるのが至難の技<br><br>「パティスリーRYOCO」<br>「パティスリーカーヴァンソン」<br><br>それでもまた食べたいと思わせる納得の美味しさですね<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/rBgQh5kRPl">pic.twitter.com/rBgQh5kRPl</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/839460001273917445">2017年3月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',839460001273917445);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">お気に入りの六本木一丁目<br>「さんて寛」<br>にてお好み焼きランチ<br><br>必ずオーダーしているイベリコ豚ポテトチーズは相変わらず美味しいし、<br><br>冬季限定の牡蠣たっぷりの <br>「かき豚」にknockoutされました、、<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/OBOHPmaeYt">pic.twitter.com/OBOHPmaeYt</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/838221967761121280">2017年3月5日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',838221967761121280);
