insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">表参道バー「TOKYO Whisky Library」<br><br>1000種のウイスキーが並ぶ棚は圧巻。外観から内観まで雰囲気◎。ウイスキーに詳しくなくてもご安心を。親切なバーテンダーの方に丁寧に案内してもらえます。日曜以外は深夜3時まで営業しているのも嬉しい<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a> <a href="https://t.co/Vg9hNaveCS">pic.twitter.com/Vg9hNaveCS</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/798181426650718209">2016年11月14日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',798181426650718209);
insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">みなとみらいバー「シリウス」<br><br>ランドマークタワーの最上階70階。バンド演奏がありオープンな空間なので、この場でギラつくような雰囲気ではないが、窓際の景色は抜群。 キスをするなら帰りのエレベーター。人がいないタイミングを見計らって乗り込もう。みなとみらいが好きなら是非<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a> <a href="https://t.co/Rs3HLzsRq8">pic.twitter.com/Rs3HLzsRq8</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/797805688634286080">2016年11月13日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',797805688634286080);
insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">渋谷「オステリアウララ」<br><br>メニューがないイタリアン。食材が書かれたでっかいボードを見ながら、店員さんと相談して前菜、パスタ、メインの料理を決めていく楽しいスタイル。オープンキッチンで雰囲気も良い。会話が自然と弾み、カジュアルでコスパも良いので最初のデートにもぴったり<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a> <a href="https://t.co/iPe3v7r6pH">pic.twitter.com/iPe3v7r6pH</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/797401260555022336">2016年11月12日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',797401260555022336);
insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">麻布十番「いいとeat ikkai」<br><br>2016年8月にオープン。お洒落に飲める和食バル。串揚げ、煮込みが美味しいです。木の温もりにランプが灯る店内は雰囲気◎。「ちょっと一杯付き合って」そう誘うのがぴったりなお店。デートの1件目でも2件目でも味方になってくれます<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a> <a href="https://t.co/CeTbe7qdKA">pic.twitter.com/CeTbe7qdKA</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/791284945473839105">2016年10月26日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',791284945473839105);
insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">表参道「たまな食堂」<br><br>心身共に和むお店。路地裏に隠れてるアットホームなお店で、発酵食材と有機野菜たっぷりなコースを楽しめます。女子から「最近飲み会続きで胃が疲れてて、、」と言われたら「美味しい野菜でも食べに行こっか」と言ってたまな食堂に誘ってみよう<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a> <a href="https://t.co/TM2ZDjfrvE">pic.twitter.com/TM2ZDjfrvE</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/790197794405351424">2016年10月23日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',790197794405351424);
insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">西麻布のバー「テーゼ」<br><br>港区にいるキラキラ女子がよく連れて行かれるバー。壁一面にライトアップされた本がずらり。かごに入ったフルーツからお好みのカクテルを作ってもらえて、このカクテルが美味しい。そして、食事もおいしい（カレーが好き）。デート以外で利用したことはないお店<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a> <a href="https://t.co/SQd4zdkgK7">pic.twitter.com/SQd4zdkgK7</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/790145231932956672">2016年10月23日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',790145231932956672);
insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">表参道のケーキ屋「アングラン」<br><br>生菓子系の手土産で、小さくてお洒落なものないかな？そう言われて思い浮かぶのがこちら。ミニャルディーズという小さなケーキは見て楽しく味も美味しい。6個箱、12個箱のパッケージがお洒落。お店もお洒落。パティシエの方がイケメン。これぞ総合力<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a> <a href="https://t.co/1PawGFblRP">pic.twitter.com/1PawGFblRP</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/788719730798370816">2016年10月19日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',788719730798370816);
insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【東京】隠れ家3選<br>初めて行くときのヒントも添えて<br><br>・六七（六本木）<br>普通の古いマンション<br><br>・WALL（表参道）<br>大きな白い壁<br><br>・Bar bin（恵比寿）<br>細い細い道<br><br>探して楽しい、飲んで楽しいお店<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a> <a href="https://t.co/0jt7DrXSaP">pic.twitter.com/0jt7DrXSaP</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/787225098629459968">2016年10月15日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',787225098629459968);
insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">みなとみらいバー「THE OCEAN’S BAR」<br><br>グランドオリエンタルにある春夏限定のルーフトップバー。開放的な空間でみなとみらいの夜景を思いっきり楽しめる。フレッシュフルーツを使ったお酒も雰囲気にぴったり。ここで飲んで海沿いを散歩するデートは本当におすすめ<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a> <a href="https://t.co/kZ9EhhmfAl">pic.twitter.com/kZ9EhhmfAl</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/853194679680024576">2017年4月15日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',853194679680024576);
insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【6000〜8000円】デートにおすすめな都内のレストラン10選<br><br>表参道：CICADA、＆ecle 、KINTAN、七代目寅<br>代官山：IVY PLACE、李南河<br>恵比寿：ジラソーレ<br>西麻布：ダルマット<br>麻布十番：ナポレオンフィッシュ<br>天王洲：T.Y.HARBOR<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/802467883338985472">2016年11月26日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',802467883338985472);
insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【8000〜10000円】デートにおすすめな都内のレストラン10選<br><br>渋谷：ドンチッチョ<br>白金台：牛鍋アイロン<br>恵比寿：Farm to tabel Y、福笑、いぐち<br>目黒：ルベロ<br>六本木：黒田屋<br>丸の内：マンゴツリー、ソルトバイルークマンガン<br>神楽坂：かみくら<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/802473778995347456">2016年11月26日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',802473778995347456);
insert into taglog(tag,tweet,tweetId) values ('こじらせゴハン', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">チーズ好きにオススメ！一風変わった和食が頂けるお店☞麻布「ふるけん」<br>オススメは餅米を蒸したものに、パルミジャーノレッジャーノ、ミモレット、クリームチーズの３種のチーズが入ったお椀「ちぃー蒸し」。<br>チーズでコーティングされた銀杏「ミモレット銀杏」もお酒がすすむ！<a href="https://twitter.com/hashtag/%E3%81%93%E3%81%98%E3%82%89%E3%81%9B%E3%82%B4%E3%83%8F%E3%83%B3?src=hash">#こじらせゴハン</a> <a href="https://t.co/eDo9eT7UEB">pic.twitter.com/eDo9eT7UEB</a></p>&mdash; こじらせコンサルタント (@kojirase_consul) <a href="https://twitter.com/kojirase_consul/status/816603768204578816">2017年1月4日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',816603768204578816);
insert into taglog(tag,tweet,tweetId) values ('こじらせゴハン', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">まるでアート作品！スイーツのフルコースが堪能できるお店3選<br>⚫︎ジャニスウォン@新宿<br>⚫︎カルメエラン@神楽坂<br>⚫︎ミラヴィルインパクト@銀座<br>黒を基調としたシックな店内のジャニスウォンでは、季節に合わせたデザートとお酒をペアリングで楽しめるので、お酒好きにも◎<a href="https://twitter.com/hashtag/%E3%81%93%E3%81%98%E3%82%89%E3%81%9B%E3%82%B4%E3%83%8F%E3%83%B3?src=hash">#こじらせゴハン</a> <a href="https://t.co/FL3Sl7IrmO">pic.twitter.com/FL3Sl7IrmO</a></p>&mdash; こじらせコンサルタント (@kojirase_consul) <a href="https://twitter.com/kojirase_consul/status/825153704680583169">2017年1月28日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',825153704680583169);
insert into taglog(tag,tweet,tweetId) values ('こじらせゴハン', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【Turandot 臥龍居@ 赤坂】<br>旬の食材をふんだんに取り入れた身体に優しい中華料理を、ラグジュアリーな雰囲気の店内で、一流のサービスを受けながら頂ける。<br>朝から営業しているので、もう少し暖かくなったら、開放的なテラス席でお粥モーニングを楽しみたい。<a href="https://twitter.com/hashtag/%E3%81%93%E3%81%98%E3%82%89%E3%81%9B%E3%82%B4%E3%83%8F%E3%83%B3?src=hash">#こじらせゴハン</a> <a href="https://t.co/oga8cIIsQt">pic.twitter.com/oga8cIIsQt</a></p>&mdash; こじらせコンサルタント (@kojirase_consul) <a href="https://twitter.com/kojirase_consul/status/846579663304454145">2017年3月28日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',846579663304454145);
insert into taglog(tag,tweet,tweetId) values ('こじらせゴハン', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">エロ旨レストランvol.1「燻製apartment」<br>オススメは暖炉席。暗闇の中ゆらゆら揺れる炎がエロい。<br>食べて欲しいのは、<br>✔︎黒毛和牛モモ肉の瞬間熟成<br>✔︎燻製卵のキャビア&amp;トリュフ乗せ<br>とろとろの熟成肉は卵に絡めて頂いて、〆はこの卵を使った卵かけご飯。<a href="https://twitter.com/hashtag/%E3%81%93%E3%81%98%E3%82%89%E3%81%9B%E3%82%B4%E3%83%8F%E3%83%B3?src=hash">#こじらせゴハン</a> <a href="https://t.co/gdMgnFzhqt">pic.twitter.com/gdMgnFzhqt</a></p>&mdash; こじらせコンサルタント (@kojirase_consul) <a href="https://twitter.com/kojirase_consul/status/834932717665996800">2017年2月24日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',834932717665996800);
insert into taglog(tag,tweet,tweetId) values ('こじらせゴハン', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">今週末はトリュフweekだった♡<br>⚫︎la Brianzaの黒トリュフグラタン<br>⚫︎十番右京のトリュフ卵かけご飯<br>⚫︎ジェニスガストロのトリュフオムレツ<br>オススメは黒トリュフグラタン。中にはトロトロの半熟卵。目の前でトリュフをスライスしてくれるパフォーマンスも◎<a href="https://twitter.com/hashtag/%E3%81%93%E3%81%98%E3%82%89%E3%81%9B%E3%82%B4%E3%83%8F%E3%83%B3?src=hash">#こじらせゴハン</a> <a href="https://t.co/sSL0UbPJww">pic.twitter.com/sSL0UbPJww</a></p>&mdash; こじらせコンサルタント (@kojirase_consul) <a href="https://twitter.com/kojirase_consul/status/810514228675084288">2016年12月18日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',810514228675084288);
insert into taglog(tag,tweet,tweetId) values ('こじらせゴハン', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">平日頑張ったご褒美に…♡<br>お洒落なお店でとびっきり美味しいモーニングを食べよう！<br>⚫︎サワムラのフレンチトースト@広尾<br>⚫︎ローダーデールのスフレ@六本木<br>⚫︎ivy placeのパンケーキ（フルーツ付）@代官山<br>⚫︎Day &amp; Nightのサンドイッチ@広尾<a href="https://twitter.com/hashtag/%E3%81%93%E3%81%98%E3%82%89%E3%81%9B%E3%82%B4%E3%83%8F%E3%83%B3?src=hash">#こじらせゴハン</a> <a href="https://t.co/FRp91Kb818">pic.twitter.com/FRp91Kb818</a></p>&mdash; こじらせコンサルタント (@kojirase_consul) <a href="https://twitter.com/kojirase_consul/status/827671834300608512">2017年2月4日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',827671834300608512);
insert into taglog(tag,tweet,tweetId) values ('こじらせゴハン', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">ブランチデートにオススメ♡☞六本木「Union Square Tokyo」<br>オススメはロブスターサンドと具沢山のコブサラダ。ロブスターサンドは3200円とお高めだけど、サクサクのパンに挟まれたプリップリのロブスターは食べる価値あり！店内の雰囲気やサービスも◎<a href="https://twitter.com/hashtag/%E3%81%93%E3%81%98%E3%82%89%E3%81%9B%E3%82%B4%E3%83%8F%E3%83%B3?src=hash">#こじらせゴハン</a> <a href="https://t.co/430cahEVpA">pic.twitter.com/430cahEVpA</a></p>&mdash; こじらせコンサルタント (@kojirase_consul) <a href="https://twitter.com/kojirase_consul/status/820438970450333697">2017年1月15日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',820438970450333697);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">恵比寿、京鼎樓 恵比寿本店。恵比寿の中華を語る上では絶対外せないお店。台湾でも超人気な小籠包は一口噛むと美味しいスープが口いっぱいに広がります。小籠包の味に関しても種類がたくさんあるので、毎回行っても飽きない楽しさがあります。是非行ってみてください。<a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/lDNBm4Md0v">pic.twitter.com/lDNBm4Md0v</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/788629890610388992">2016年10月19日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',788629890610388992);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">麻布十番、たぬ吉。よくテレビ番組の打ち上げとかでも使われているお店。オススメは一番人気のマグロブラックです。柔らかいマグロ肉に胡椒がしっかり効いていて病みつきになります。他にも赤味噌ソース添えのマグロレッドやマグロのトロかつと絶品のマグロ料理を堪能できます。<a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/jPL1PPd5L9">pic.twitter.com/jPL1PPd5L9</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/792950127921016832">2016年10月31日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',792950127921016832);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">神泉のぽつらぽつら。基本的にはコース料理のお店になっていて、食べたのは4,500円のコース。前菜のテリーヌや2枚目の写真にある盛り合わせもとても美味しく、季節のお刺身、揚げ物、メインのお肉料理までとても丁寧で美味しかったです。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/KOHQihEJR6">pic.twitter.com/KOHQihEJR6</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/793323482650062848">2016年11月1日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',793323482650062848);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">中目黒 路地裏酒場 青コーナー。 古民家を改築した、建物、人、食べ物全てが暖かいお店。オススメは圧倒的にパクターメンマ。甘辛いメンマとひき肉が、パクチーの独特の味で一気に引き締まります。ビーフシチューも美味しくてオススメです。<a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/Wx0zVqV4DC">pic.twitter.com/Wx0zVqV4DC</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/795569248680542208">2016年11月7日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',795569248680542208);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">赤坂 みすじ。どのお肉を食べても美味しいんですけど、中でもお肉の王様と言われるシャトーブリアンはサシの入り方、口どけ、甘み、なにを取っても最高でした。個人的には大根おろしを包んで食べるみすじ？もとても好きです！また近いうちに必ず行きます。<br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/Wdubz7cnFU">pic.twitter.com/Wdubz7cnFU</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/798470480264994817">2016年11月15日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',798470480264994817);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">南麻布、海南鶏飯食堂。六本木や恵比寿に系列店がある、シンガポールチキンライスのお店。3種のソースとジューシーな鶏肉を、鶏肉の出汁で炊いたパラパラのご飯とともにいただきます。パクチーもお好みでつけられ、個人的には黒い甘辛ソースとの組み合わせが最高に好きです。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/aOMbC7fwhc">pic.twitter.com/aOMbC7fwhc</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/799486190890131456">2016年11月18日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',799486190890131456);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">この前の生ハムのお店は六本木、オービカ。生ハム以外にも水牛のモッツァレラチーズの6種盛りや、トリュフが乗ったピザ、オマール海老とズワイ蟹のパスタを食べましたが、どれもとても美味しかったです。特にトリュフのピザはみんなで美味しい美味しいってずっと言ってましたw<a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/qz5IPc2RfP">pic.twitter.com/qz5IPc2RfP</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/800589930825011200">2016年11月21日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',800589930825011200);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">昨日のお店は渋谷、やきとん大地。デザートはもちろん、3枚目のしば漬け入りポテトサラダは塩っけとポテトのまろやかさが絶妙。8本盛りは野菜ぐし2つにやきとんが6本でした。お店の場所もエレベーターで最上階に行き、さらに階段を上がる隠れ家的なお店で良かったです。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/WHdHDDQInF">pic.twitter.com/WHdHDDQInF</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/800905482185494529">2016年11月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',800905482185494529);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">麻布十番、右京。名物のトリュフ卵かけご飯が有名なお店。目の前で卵かけご飯にトリュフを削ってくれるので、削りたての芳醇な香りを楽しめながらいただけます。1枚目のフォアグラご飯も甘辛のソースと一緒に。日本酒も100種類以上置いてあってお酒好きにもおすすめです！<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/Hj7Cd8SUNh">pic.twitter.com/Hj7Cd8SUNh</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/801633860886765568">2016年11月24日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',801633860886765568);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">西麻布、五行。見た目が真っ黒で最初驚くんですけど、一口食べると焦がし醤油の香ばしく濃厚な香りが口いっぱいに広がり、虜になるラーメン。店内の雰囲気もバーのようで、夜にはお酒も出ます。ラーメンはそんなに好きではないのですが、この時はペロリと食べました！<br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/i2JGwktedT">pic.twitter.com/i2JGwktedT</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/802026238202167296">2016年11月25日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',802026238202167296);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">恵比寿、松玄。ランチでも個室が取れるお蕎麦屋さんで、地味に便利。店内は落ち着いている雰囲気です。食べたのは土日限定ランチメニューの旨辛肉パクチーそば。個人的にあまり辛さはなかったのですが、すごくパクチーとお蕎麦とあったのでリピート決定です。<a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/Z0w4zUH72m">pic.twitter.com/Z0w4zUH72m</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/810695186460225536">2016年12月19日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',810695186460225536);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">今日の <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> は最近中目黒にできたお店、フツウニフルウツ。代官山と中目黒の間にあるこのお店は、エスプレッソとフルーツサンドが専門。キウイやイチゴの酸味と、クリームの甘さが食べやすくサンドしてあって、3時のおやつにぴったり！エスプレッソのほろ苦さとも相性抜群です！！ <a href="https://t.co/at8ywEIB4e">pic.twitter.com/at8ywEIB4e</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/813258768041406464">2016年12月26日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',813258768041406464);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">今日の <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> は恵比寿のクリスプサラダワークス。定番のシーザーサラダや、好きなサラダをカスタムオーダーでき、目の前で作ってくれるお店。今日はクラシックのチキングリルシーザーサラダを注文しました。めちゃくちゃボリュームがあるのに404kcalと優しいお店です。 <a href="https://t.co/9a6L93ZsSX">pic.twitter.com/9a6L93ZsSX</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/819038981648093185">2017年1月11日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',819038981648093185);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">いぐち 上ル、恵比寿。恵比寿駅から少し歩いたところにあるビルの5階にある、12席のカウンターしかないお店です。コース料理しかなく、出て来る料理はどれも美味しかったです。個人的には定番のエビ天、あと一口カツサンド、季節のかき揚げがとても美味しかったです。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/lMdhMqCxaI">pic.twitter.com/lMdhMqCxaI</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/819440454374567936">2017年1月12日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',819440454374567936);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">池袋、牛蔵。リーズナブルというか格安でA5ランクの国産牛を食べることができる池袋で一番と思う焼肉屋さん。人気すぎて大体3ヶ月先？くらいまで予約が取れません。しかし、当日直接店舗に行くと本当に稀に席が空いてることも…！焼肉好きなら一回は行っておきたいお店です<a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/MljQqyL3d7">pic.twitter.com/MljQqyL3d7</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/824456445584248832">2017年1月26日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',824456445584248832);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">恵比寿、ブラッカウズ。肉厚でジューシーな和牛100%のハンバーガーが有名なお店。バンズがめちゃくちゃフワフワで、少し食べにくいくらいの大きさです笑<br>店内には女性も多く、代官山/恵比寿エリアでおしゃれなハンバーガーを食べたい時には是非行ってみてください！<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/9MtHIa5bt1">pic.twitter.com/9MtHIa5bt1</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/826691547370450944">2017年2月1日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',826691547370450944);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">tooth tooth、恵比寿。店内がおしゃれなフレンチ。行くとカップルが多いからなかなか1人ではいけませんが、行くとフォアグラとパルミジャーノチーズのリゾットは絶対食べて欲しいです。甘口の白ワインと一緒にどうぞ。今日確認したらまだ明日空いてるらしいですよ！<br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/WGbYaY9go4">pic.twitter.com/WGbYaY9go4</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/828891067583901696">2017年2月7日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',828891067583901696);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">新宿のうどん屋さん、慎。おいしい讃岐うどんが食べられるお店です。特徴はやっぱりこの捻られたツヤツヤの絶品うどん！写真を撮るのを忘れてしまいましたのでぐるなびの写真で許してください笑<br>店内は少しこじんまりとしていて、友達と行くのがいいかもです！<a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/9xL6axOjSR">pic.twitter.com/9xL6axOjSR</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/845848345981550592">2017年3月26日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',845848345981550592);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">渋谷、チーズスタンド。できたてのチーズをその場で出してくれるお店。リコッタチーズのハチミツがけは絶品。お店の思いにある、北海道や外国のチーズをわざわざ運んで食べるのはもったいないから自分たちで作って提供するっていう思いがとても素敵なお店です！<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/sCliDi7nan">pic.twitter.com/sCliDi7nan</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/813608386541416448">2016年12月27日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',813608386541416448);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">恵比寿、初代。テレビにもよく取り上げられる「白いカレーうどん」が有名。白いトッピングの正体はジャガイモのムースで、その層の下にカレーうどんが入ってます。カレーうどん自体は少し甘めかなーって思いました。ムースのせいかな？店内がおしゃれですよ！接客も🙆<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/3jvR2JHPyh">pic.twitter.com/3jvR2JHPyh</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/806843620523290624">2016年12月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',806843620523290624);
insert into taglog(tag,tweet,tweetId) values ('食べるちゃんねる', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">渋谷、左五右衛門。リーズナブルでどの料理も美味しく、店員さんも笑顔でとても雰囲気が好きなお店。どの串も美味しいのはもちろんですが、一品料理の山芋のもっちり揚げも美味です。いつも予約がパンパンなので行くなら予約は早めに！最近2号店が出ました！<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B9%E3%82%8B%E3%81%A1%E3%82%83%E3%82%93%E3%81%AD%E3%82%8B?src=hash">#食べるちゃんねる</a> <a href="https://t.co/t0gUiSw4b2">pic.twitter.com/t0gUiSw4b2</a></p>&mdash; 食べるちゃん (@taberu_chan) <a href="https://twitter.com/taberu_chan/status/811441519622139904">2016年12月21日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',811441519622139904);
insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">乃木坂の『肉匠なか田』へ行ってきました♪ニンニクが効いたタレや珍しいお塩、わさび醤油など色んな食べ方がありましたが、個人的には卵に絡めてすき焼き風に食べるスタイルが一番好きでした✨<br>自己満インスタで食べ物インスタも始めたのでよかったら見てください（笑）【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/MqzBGj3oeq">pic.twitter.com/MqzBGj3oeq</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/807810721853472768">2016年12月11日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',807810721853472768);
