insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">恵比寿『黄金屋 隠れ艶』<br>完全個室で落ち着いたお店でした！<br>人気店なだけあって9時半過ぎても予約のお客さんでいっぱいでお店を出なきゃいけない時間になってしまい〆の雑炊が食べれなかったのが心残り！<br>こってりが食べたい気分だったので味噌を選びました♪<br>Instagram【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/bEk3Gn9T0J">pic.twitter.com/bEk3Gn9T0J</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/813327011825340416">2016年12月26日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',813327011825340416);
