insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">六本木『黒猫夜』<br>友人に隠れ家っぽいお店に連れてってもらいました♪扉からインパクトがあり、中に入ると少し薄暗くて怪しげな雰囲気ですが台湾っぽい景色が広がり照明がとってもいい感じで落ち着いきます♪普段食べることがない料理やお酒が置いてありどれも新鮮で楽しかったです✨<br>【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/ULXvVMzqD4">pic.twitter.com/ULXvVMzqD4</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/832535748045795329">2017年2月17日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',832535748045795329);
