insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">北千住のレトロな商店街にあるお餅と日本茶専門店「月光」<br>都内でもなかなか食べられない搗き立ての艶々なきめ細やかなお餅がいただけます。<br>きなこもちとからみもち(大根おろし)は絶品。静岡産の特上芽茶と共にいただきました。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/b7iBHmQbA3">pic.twitter.com/b7iBHmQbA3</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/798347133262794754">2016年11月15日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',798347133262794754);
insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">京都の風味豊かな冠煎茶とセルフでお餅が焼けるのを都内で手軽に楽しめるのは「ぎおん徳屋 原宿店」<br>じっくり炊いた最高級の丹波産大納言のぜんざいに自分で焼いたお餅を入れて食べるなんて楽し過ぎて時間が経つのを忘れちゃう。そして焦がす罠。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/sLHODX928D">pic.twitter.com/sLHODX928D</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/798343739714342912">2016年11月15日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',798343739714342912);
insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">銀座の老舗カフェ「銀座トリコロール」<br>注文後にクリームを詰めてチョコで仕上げる看板メニューのエクレアと、泡立てた濃いめのコーヒーにオレンジリキュールを加えるカフェ・コアントローをいつも頼みます。至福の時。<a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/gXYu1bueWA">pic.twitter.com/gXYu1bueWA</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/798338078720987136">2016年11月15日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',798338078720987136);
