insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">無水キーマカレー+炙りチーズ+半熟卵+パクチー❤︎の「ケニックパクチースペシャル」ビールを飲む為ご飯を半分でオーダー。なにこれめちゃ美味しい上に食べても食べても溢れるパクチー…幸せしかないよ、ここ。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/9bBjHlWmGf">pic.twitter.com/9bBjHlWmGf</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/790793188537536512">2016年10月25日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',790793188537536512);
insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">美味しいすき焼き屋は数あれど水火鉢の風情を楽しめるのはここ「伊勢重」のみ。手切りのお肉の美味しさは言わずもがな。宮内庁御用達のしらたきと明治2年創業時から受け継がれる秘伝の割り下に五秒くぐらせたシャッキシャキのえのきに悶絶。老舗で全個室なのに割とカジュアルなのも◎<br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/dELCLlE7OZ">pic.twitter.com/dELCLlE7OZ</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/788862329379180544">2016年10月19日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',788862329379180544);
insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">純喫茶「トミィ」<br>老齢の店主が注文を受けてから鉄板で丁寧に焼いてくれる素朴なホットケーキ、ブレンドコーヒーはスッキリしたアメリカンテイスト。サイフォンで淹れたコーヒーは飲み終えても豆の香りを鼻腔で感じます。深煎り好きの方にもオススメ。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/vdGSNNsfgq">pic.twitter.com/vdGSNNsfgq</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/784878510091309056">2016年10月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',784878510091309056);
insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">芝公園近くにあるハンバーガー専門店「MUNCH&#39;S BURGER SHACK」<br>アボカドチーズバーガー<br>味良しボリューム良し。目一杯オクチを開けてあーんってしても<br>「や…おっきくて入らないよう…」となります。はい。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/BEabMmRnao">pic.twitter.com/BEabMmRnao</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/722912475369181186">2016年4月20日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',722912475369181186);
insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">神田の洋食屋「ルードメール」<br>ドライカレーのオムレツ乗せが有名ですが私はハンバーグカレーがとても好み。半熟の目玉焼きも乗ってるので割って混ぜると二度美味しいのです。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/u1rkj1JcyS">pic.twitter.com/u1rkj1JcyS</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/725875961032400897">2016年4月29日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',725875961032400897);
insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">勝どきの立飲み屋「かねます」<br>毛がにサラダ、生うに牛巻き、牛にこみはもはや三種の神器。毛がにサラダは蟹味噌たっぷり、牛にこみは恐ろしいほどに美味しい。<br>や…おクチの中で…とろけちゃう…<br>ってヤツです。悶絶モノ。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/JCiKTorq2h">pic.twitter.com/JCiKTorq2h</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/737885552284979200">2016年6月1日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',737885552284979200);
insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">自由ヶ丘「和バル sou」<br>雲丹の黒毛和牛巻きはこちらが上手。ため息出ちゃう。毛ガニ一杯まるまるサラダは小ぶりなので蟹味噌と合わせて酒のアテに◎。にごり酒やスパークリングの日本酒があるのでテンション上がります。<br><br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/6mEmjZnw9f">pic.twitter.com/6mEmjZnw9f</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/737889397484490752">2016年6月1日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',737889397484490752);
insert into taglog(tag,tweet,tweetId) values ('げすろぐ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">wagura（代官山）<br>代官山駅徒歩3分の完全予約制創作和食。おしゃれな店内、5000円のコース。極め付けはセルフサービスの飲み放題。スパークリングもビールもつぎ放題で男性1800円女性1500円。食べログの評価すら追いついていない隠し玉。女子会にもデートにも是非。<a href="https://twitter.com/hashtag/%E3%81%92%E3%81%99%E3%82%8D%E3%81%90?src=hash">#げすろぐ</a> <a href="https://t.co/OWtvPoPJJG">pic.twitter.com/OWtvPoPJJG</a></p>&mdash; おめが (@PedkQ) <a href="https://twitter.com/PedkQ/status/829234754885132289">2017年2月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',829234754885132289);
insert into taglog(tag,tweet,tweetId) values ('げすろぐ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">五行（西麻布）<br>デートでラーメンと言ったら絶対にここ。コンセプトは「飲んでつまんで麺で〆る」。ラーメン店とは思えないおしゃれさと、一風堂の経営母体がなせる確かなラーメンの味。焦がし味噌（890円）がおすすめ。<a href="https://twitter.com/hashtag/%E3%81%92%E3%81%99%E3%82%8D%E3%81%90?src=hash">#げすろぐ</a> <a href="https://t.co/LfZBeO1pf8">pic.twitter.com/LfZBeO1pf8</a></p>&mdash; おめが (@PedkQ) <a href="https://twitter.com/PedkQ/status/783664106905571330">2016年10月5日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',783664106905571330);
insert into taglog(tag,tweet,tweetId) values ('げすろぐ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">カラペティバトゥバ（麻布十番）<br>食べログで4.12と驚異的な数字を叩き出す超有名ワインビストロ。ここにさらっと来て、食べたいもの食べてグラスでワインを飲める大人になりたいと感じさせてくれる人気店。落ち着いてるんだけど活気があって、行きつけにしたい雰囲気を纏ったお店。<a href="https://twitter.com/hashtag/%E3%81%92%E3%81%99%E3%82%8D%E3%81%90?src=hash">#げすろぐ</a> <a href="https://t.co/y0gG9k4QVf">pic.twitter.com/y0gG9k4QVf</a></p>&mdash; おめが (@PedkQ) <a href="https://twitter.com/PedkQ/status/786562743113437184">2016年10月13日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',786562743113437184);
insert into taglog(tag,tweet,tweetId) values ('げすろぐ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">モルソー（目黒）<br>目黒駅徒歩3分。誘い文句は「シェフの奥様とソムリエのご主人がやってる素敵なワインビストロあるんだけど行かない？」店名のmorceauは「かけら」という意味。ワインと食事を最後まで堪能すると欠片が集まって１つの幸せが生まれるでしょう。ラブホのお隣。<a href="https://twitter.com/hashtag/%E3%81%92%E3%81%99%E3%82%8D%E3%81%90?src=hash">#げすろぐ</a> <a href="https://t.co/tWmj9NeXKG">pic.twitter.com/tWmj9NeXKG</a></p>&mdash; おめが (@PedkQ) <a href="https://twitter.com/PedkQ/status/784723014487158784">2016年10月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',784723014487158784);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">銀座『ヴァンピックル』フレンチな串焼きが楽しめるビストロ。レバーパテに始まり、フォアグラやつくねを頬張りながらワインがすすむすすむ。写真はないけどポトフも美味しかったから、この時期また食べに行きたいなぁ。 <a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/RfUehNPHKl">pic.twitter.com/RfUehNPHKl</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/807179802075504640">2016年12月9日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',807179802075504640);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">神泉『定食 サトウ』7品の小鉢と美味しいおかずが食べれる大好きな定食屋さん。清潔感のあるお店はいつも満席。お昼であれば12時ぴったりを目指して行かないと中々入れません。日替わりの献立はブログでチェックできるのも楽しみ。 <a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a><a href="https://t.co/dphRSEHbrn">https://t.co/dphRSEHbrn</a> <a href="https://t.co/lssAAM5cIW">pic.twitter.com/lssAAM5cIW</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/811452537119252480">2016年12月21日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',811452537119252480);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">もういっちょ！恵比寿すずらん🍜蛤ラーメンしゅごい🙄 <a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/FTqOBjLJph">pic.twitter.com/FTqOBjLJph</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/851772280287903744">2017年4月11日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',851772280287903744);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">昨夜はタヴァンで肩肘張らないディナーを堪能🍴やっぱり夜景を見るとテンションがあがるものですね🌃 <a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/jJSHJwUk5R">pic.twitter.com/jJSHJwUk5R</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/832042654116360192">2017年2月16日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',832042654116360192);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">新宿『天秀』さっくさくの絶品天ぷらがリーズナブルに頂ける老舗店。なかなか予約のとれない人気店ですが、ふらっといけば入れることも。締めはかき揚げ天丼か天茶が選べます。天丼も文句無しに美味しいのですが、とにかくここの天茶が大好きなので是非おすすめしたい！ <a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/NEDfHGo4xO">pic.twitter.com/NEDfHGo4xO</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/806713780994392064">2016年12月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',806713780994392064);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">恵比寿『の坂』こじんまりとしたお店で頂く日本酒と和食。カウンターで一人しっぽり行きたい時に重宝する店。一品一品丁寧や料理と強面な大将、明るい女将さんとの会話が愉しい。ランチでも頂ける肝入り親子丼はふわっふわな鶏肉とレバーに山椒がピリっと効いていて最高。<a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/Cmx71QzCV2">pic.twitter.com/Cmx71QzCV2</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/802863516675764224">2016年11月27日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',802863516675764224);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">恵比寿『レストラン間』 アミューズのフォアグラクロワッサンにはじまり、名物野菜パフェでテンションは最高潮に。野菜のオーケストラと謳うフルコースが4,500円とコスパ良し。女子会やカジュアルデートで外さない恵比寿の人気店。<a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/poZKXSNTc1">pic.twitter.com/poZKXSNTc1</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/802073527213928449">2016年11月25日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',802073527213928449);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">新宿『川香苑』 新宿でご飯食べる時は絶対候補に入る店。日本人に媚びない四川料理。それにしても歌舞伎町には穴場中華が多いですね。ここの豚バラにんにくソースがけがお酒が進むのなんので、中華の前菜分野で私史上圧倒的1位を誇るメニューです。<a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/fVIj14MPAK">pic.twitter.com/fVIj14MPAK</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/798538227959230465">2016年11月15日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',798538227959230465);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">芯から冷えるこんな日は中目黒『いふう』の雲丹の土鍋ご飯が食べたい。実家に帰ったように熱烈に歓迎してくれる名物女将と心ゆくまで話して、ほろ酔い千鳥足で目黒川沿いを歩きたい。<a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/UBJ3qa39oX">pic.twitter.com/UBJ3qa39oX</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/798172499175321600">2016年11月14日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',798172499175321600);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">馬車道『カフェ オムニバス』 圧倒的にフォトジェニックな空間で最近はCM等でも見かけるカフェ☕土日も比較的空いてるのとWi-Fi&amp;電源完備でノマドワーカーには最高の場所💻コーヒーは勿論アルコールも充実していて、土日も案外空いてるので横浜デートや女子会のひとときに🙆 <a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/6eARaAiSf2">pic.twitter.com/6eARaAiSf2</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/797810754304905216">2016年11月13日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',797810754304905216);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">リッツの『ザ・ロビーラウンジ&amp;バー』で休日を締める。ピークラウンジも好きだけど、この時間帯に利用するならここが最高だと思う。東京ド真ん中の夜景にレベルの高い生演奏、シチュエーションに酔える場所。 今日はムーンリバー聞けたので満足。 <a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> (飯なのかは謎) <a href="https://t.co/YaWVgN7WJk">pic.twitter.com/YaWVgN7WJk</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/794175062337196032">2016年11月3日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',794175062337196032);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">恵比寿『イエローカンパニー』で休日スープカレー🍛定番の角煮ベジタブルに海老の風味がっつりのスープが大好き🍤おまけにベーコン+アボカド+モツァレラチーズをトッピング😋 <a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/TodyvI3FGY">pic.twitter.com/TodyvI3FGY</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/794074016424161281">2016年11月3日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',794074016424161281);
insert into taglog(tag,tweet,tweetId) values ('まなてぃ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">寒くなると無性に炊き込みご飯が食べたくなる。今まさに食べたいのは『広尾 小野木』のオマール海老の炊き込みご飯。店内は食幹よりカジュアルな雰囲気で会食はもちろんデート使いにも。天現寺交差点にあるので二軒目バーにも困らないのが嬉しいところ。 <a href="https://twitter.com/hashtag/%E3%81%BE%E3%81%AA%E3%81%A6%E3%81%83%E9%A3%AF?src=hash">#まなてぃ飯</a> <a href="https://t.co/7QxQ21f2Yo">pic.twitter.com/7QxQ21f2Yo</a></p>&mdash; まなてぃ (@manaty_lip) <a href="https://twitter.com/manaty_lip/status/793830736147034112">2016年11月2日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',793830736147034112);
insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">東陽町駅「らぁ麺やまぐち 辣式」<br>ミシュランに掲載された高田馬場駅「やまぐち」の2号店<br>こちらは、塩らぁ麺と麻婆まぜそばの2種類<br>私は、塩らぁ麺海老わんたん煮卵トッピング1,070円…当たり前だけど美味しかったですよ。はい<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/iGQuTcWf9Q">pic.twitter.com/iGQuTcWf9Q</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/837142442881122304">2017年3月2日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',837142442881122304);
