insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">飯田橋駅 西口 「びぜん亭」支那そば、ラーメン<br><br>都内で1番好きな支那そば屋さんかもしれない…濃厚とろとろチャーシューに味が染み込んでる卵…サラッと食べれちゃうよね！<br>何より店主の人柄がいい！いつでも優しく笑顔で迎えてくれるの最高<br><br>支那そば600円味玉100円<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/ETdpVKdioW">pic.twitter.com/ETdpVKdioW</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/826353315080331264">2017年1月31日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',826353315080331264);
insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">秋葉原駅「紬麦」ラーメン<br>太麺で有名なお店です！美味しいの！はふはふしながら一瞬で食べ終わったよ！！！<br>家系じゃないのにほうれん草入ってるの最高だよね<br>つけ麺のが有名なのかな？<br><br>ラーメン800円<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/eu0YZyvYe4">pic.twitter.com/eu0YZyvYe4</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/813700821640585216">2016年12月27日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',813700821640585216);
