insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">飯田橋 神楽坂 「牡蠣屋バル」オイスターバー<br><br>牡蠣やワインの種類が豊富、意外と言っては失礼なんだけど…パスタはどれを食べても美味しい。でも、オススメはイカスミね！<br>カウンターがあるので独りでふらっと入れる。牡蠣を食べたくなるとここに行きます。<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/80xE3IK6UA">pic.twitter.com/80xE3IK6UA</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/798132823039217665">2016年11月14日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',798132823039217665);
