insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">「salon de sabou」<br>茶房パフェの升パフェめっちゃ美味しそうだし、全長30cmの季節のパフェのタワー感ヤバすぎて、行きたすぎる！！<br>(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a> ) <a href="https://t.co/6Vc1ATqxvn">pic.twitter.com/6Vc1ATqxvn</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/855387913424584704">2017年4月21日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',855387913424584704);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">『gram プレミアムパンケーキ』<br>絵本に出て来そうなパンケーキ。<br>ナイフを入れた時から「？！」、綿アメのようにシュっと溶ける。雲のように軽い食感🤗💕3枚あって、高さは凄いのだけど、とても軽くて、一瞬でペロリ😋(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a> ) <a href="https://t.co/m3YJgw1icS">pic.twitter.com/m3YJgw1icS</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/839041879182196736">2017年3月7日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',839041879182196736);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">ブルガリレストランでランチ。写真が下手で申し訳ない。(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a> ) <a href="https://t.co/MEq8twUXfQ">pic.twitter.com/MEq8twUXfQ</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/836090545785221120">2017年2月27日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',836090545785221120);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">もし、どこか1つのお店のパフェしか食べられないとしやら、ふみは、迷わず『中野屋』のパフェをチョイスする。その芸術性の高いパフェと、美味しさがあれば、いつまでも夢見心地でいれそう。(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a> ) <a href="https://t.co/SpAyCwuZbC">pic.twitter.com/SpAyCwuZbC</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/818742592833630208">2017年1月10日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',818742592833630208);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">フレンチトースト専門店の『アイボリッシュ』。<br>フルーツとフレンチトーストの組み合わせは、甘いものが欲しい時にガッツリ頂きたい。(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a> ) <a href="https://t.co/flRZJlTxGM">pic.twitter.com/flRZJlTxGM</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/814832908145803264">2016年12月30日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',814832908145803264);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">ホテルニューグランドの、パフェ。意味わからないくらい魅力的。(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a> ) <a href="https://t.co/hhkLHDhNh5">pic.twitter.com/hhkLHDhNh5</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/806804944456036353">2016年12月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',806804944456036353);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">中華って、いっぱい色んなものを食べたいけれど、大皿故に、大人数じゃないと行きづらい…。と、思った時に、紹介されたのが、『六本木 虎峰』美味しいものをちょっとずつ、沢山食べれるのが魅力的💕器も美しくて、目でも楽しめる☺️(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a> ) <a href="https://t.co/UcaGVySBOp">pic.twitter.com/UcaGVySBOp</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/806414087257092096">2016年12月7日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',806414087257092096);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">『336 ebisu』って、凄く女子会向け。オシャレでシンプルな店内に、野菜いっぱいのフォトジェニックなお料理たち。そして、昼間っからワインを飲めるのも、女子には嬉しいよね。(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/lZxFriXKHW">pic.twitter.com/lZxFriXKHW</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/803148239255916544">2016年11月28日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',803148239255916544);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">流行りにのって、ふみの大好きな雲丹いくら土鍋ご飯を紹介☺️💕<br>『六本木 魚輝』たーーーーっぷりのいくらとたーーーーっぷりの雲丹が、輝く贅沢な一品😍💕ふみはここの雲丹いくら丼が大好物🙆🏻💕食べるには予約が必須です🙌🏻(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/rcCHp6qBHg">pic.twitter.com/rcCHp6qBHg</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/798182920351412224">2016年11月14日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',798182920351412224);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">妹と妹の彼氏が東京に来たので、『GINZA KOSO』でお誕生日会🎂🎉🎊👏<br>普段はカウンターだけど、バカ騒ぎをしたい時には、個室に👯💋鉄板焼きのお店で、お肉を色んな方法で食べれて、朝の3時までやってる超便利なお店💕(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a> ) <a href="https://t.co/HM3uDhoXdP">pic.twitter.com/HM3uDhoXdP</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/797754093842219012">2016年11月13日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',797754093842219012);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">安くて美味しいは人を幸せにする😇💕『渋谷 とりかつ』サクサクジューシーな豚カツの肉汁🍖甘くて懐かしい味のハムカツ💞それでいて、好きなカツを2品選べて650円という安さ🙌🏻💕男飯なら3品650円😫✨満足度は最の高💫(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/3Mle1qj8G7">pic.twitter.com/3Mle1qj8G7</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/789307818172047360">2016年10月21日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',789307818172047360);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">女子会&amp;デートには、あのミシュラン🌟の味を手頃な味で頂ける。『ランベリービス』あのランベリーが夜だけ、ビストロを展開しております🍴💕お味は語る必要がないと思うので省略🙆🏻素晴らしいのは、表参道でLO24:00🙌🏻💕(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/eduToMh1Hz">pic.twitter.com/eduToMh1Hz</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/789015808902955008">2016年10月20日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',789015808902955008);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">『肉の田じま』<br>すき焼き御膳を🍴お肉屋さんのすき焼きだけあって、松坂牛のすき焼きはお肉とろっとろ🌊💕ハンバーグ定食は黄身のとろとろと肉汁の合わせ技に幸福物質が😍💞高級松坂牛を1000円代で食べられる幸せを噛み締める💏💕(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/1Hr7Zdmc4z">pic.twitter.com/1Hr7Zdmc4z</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/788641285804392448">2016年10月19日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',788641285804392448);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">ふみが何気に愛しているのが、『紅れや 池袋』池袋とコリドー街にある牛タンしゃぶ&amp;タコしゃぶのお店。牛タンもタコも両方、お野菜もたっぷり食べれるから罪悪感も少ない。数々の肉料理も🙆<br>ふみは、高級感のある池袋店のがお気に入り(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/EGEvgmOaHl">pic.twitter.com/EGEvgmOaHl</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/784639053064904704">2016年10月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',784639053064904704);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">新宿でお洒落にデートするなら、『銀彗富運』💫あの人気店『彗富運』の2号店🙌2000本以上のワイン🍷があり、ワイン通&amp;女の子には🙆💕<br>看板メニューのグラタンは、ミソとクリームの濃厚さが病み付きに…☺️💕<br>安くてコスパ最強🙏(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/rRcJ0XbAid">pic.twitter.com/rRcJ0XbAid</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/784327759665389572">2016年10月7日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',784327759665389572);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">『五反田 あげ福』のカツが美味しい〜〜〜😭💕レアのお肉で、噛んだら柔らか〜😫💕最高だったし、安いし美味しいし最の高ッ!!!!!!!!<br>矢澤ミートさんの揚げ物専門店だから、味、お肉は折り紙つきッ♡♡(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/VKI8H5ooK9">pic.twitter.com/VKI8H5ooK9</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/782502263180791808">2016年10月2日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',782502263180791808);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">『池袋:RACINES』<br>産地直送の野菜、お肉が美味しく、オリジナルのドレッシングがあれば、ボールいっぱいの野菜が食べれそう。<br>焼きたてのパンが頂ける&amp;買えるし、出されるバターがホイップのようにふわふわで美味しいの♡(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/eimvOMoKuT">pic.twitter.com/eimvOMoKuT</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/775293343177674752">2016年9月12日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',775293343177674752);
insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">新宿に来たら、毎回ここ来ちゃうなぁ。『新宿:魚人食堂』<br>定食が安くて美味しくて、ご飯の量が選べて、ご飯と豚汁はお代わり自由。(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/dNnFWQnAvD">pic.twitter.com/dNnFWQnAvD</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/775257828277620736">2016年9月12日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',775257828277620736);
