insert into taglog(tag,tweet,tweetId) values ('げすろぐ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">CORK（南青山）<br>料理に合うワインを提案するのではなくワインから料理を組み立てる新たなスタイル。おしゃれなガラス張りの外観でコの字型のカウンターは2人の距離を近づける。7400円で4種のワインと料理のマリアージュ。事前に頼めば隣の人気フレンチL&#39;ASのメニューも。<a href="https://twitter.com/hashtag/%E3%81%92%E3%81%99%E3%82%8D%E3%81%90?src=hash">#げすろぐ</a> <a href="https://t.co/rGBtyyFLAA">pic.twitter.com/rGBtyyFLAA</a></p>&mdash; おめが (@PedkQ) <a href="https://twitter.com/PedkQ/status/855669890136461312">2017年4月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',855669890136461312);
insert into taglog(tag,tweet,tweetId) values ('げすろぐ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">アトリエ・ド・アイ（広尾）<br>シェトモの精神を受け継ぐとっておきのビストロ。どの駅からも少し距離のある陸の孤島な立地が隠れ家感を増す。店内は心地よい空間づくりで完璧なデート向き雰囲気。アラカルトもワインも充実していて入り口はinstalikeなので必見。<a href="https://twitter.com/hashtag/%E3%81%92%E3%81%99%E3%82%8D%E3%81%90?src=hash">#げすろぐ</a> <a href="https://t.co/1MvY6CSU2C">pic.twitter.com/1MvY6CSU2C</a></p>&mdash; おめが (@PedkQ) <a href="https://twitter.com/PedkQ/status/855378779341938689">2017年4月21日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',855378779341938689);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">雨の東京タワーの下で、<br>牧草牛フィレとロングフェッドのサーロインを  <br><br>もちろん名物のラムチョップも相変わらず美味で、、もうコンスタントに伺っています<br><br>「WAKANUI」さんはこれぞ東京、ですよね<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/0LdKsjJ7Ko">pic.twitter.com/0LdKsjJ7Ko</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/855782812317696001">2017年4月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',855782812317696001);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">神保町のSTYLE&#39;S CAKES &amp; CO.ってタルトも美味しいんだけど、キッシュの台のサクサク感、卵の硬さと具の量のバランス、焼き加減が完璧すぎてこれ以上のものは食べたことない！うち遊び来る時必ずこれ持って来てくれる後輩をめっちゃかわいがってるのは言うまでもないw <a href="https://t.co/QxWohkGrFf">https://t.co/QxWohkGrFf</a></p>&mdash; マデレン (@mymadelaine) <a href="https://twitter.com/mymadelaine/status/855008110414397441">2017年4月20日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',855008110414397441);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">今朝は都内随一のカレーパンを求め高輪台「セイジアサクラ」へ<br><br>運良く焼きたてが上がったタイミングで2つゲット。<br><br>グリュイエールチーズたっぷり「チーズカレー」(318円)<br><br>ごろっと大きくカットされた野菜、まさにカレーが丸ごと入ったチーズパン<br>週2回は朝食にしたい<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/wRCrkl807X">pic.twitter.com/wRCrkl807X</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/855640421766012929">2017年4月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',855640421766012929);
