insert into taglog(tag,tweet,tweetId) values ('ふみ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">『東銀座 海栗BAR kai一章』<br>ふみも行かなきゃと思っているお店🤔雲丹の食べ比べ出来るこのお店は、雲丹好き必見だね🤗💕オリジナル雲丹料理も豊富💫雲丹に合わせて美味しい日本酒🍶やシャンパン🥂を頂けるのも魅力の一つ❤️(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a> ) <a href="https://t.co/g7angaRwWN">pic.twitter.com/g7angaRwWN</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/856532785401442304">2017年4月24日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',856532785401442304);
