insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">パスタ対決🍝<br>京橋「フィオレンツァ」カルボナーラ/不思議とカレーの香りがするもちもちパスタ。こってりなのに後味すっきり。<br>下北沢「バールアリメンターリ ダニエラ」タヤリン(サマートリュフかけ)/目の前で黒トリュフを削るのでとても薫り高く細麺に絡まる濃厚なソースが絶品。<a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/SUqRsk2754">pic.twitter.com/SUqRsk2754</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/864431250936799233">2017年5月16日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',864431250936799233);
