insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">秋葉原駅「炉端バルさま田」のかつ丼が、唯一無二の存在感！とろとろのオムレツがのっかって、とろり～んとほどけちゃう。衣のなかはよく煮こまれた角煮なので、ハシでさくさく切れちゃうよ <a href="https://t.co/SsPGb5ZzZL">pic.twitter.com/SsPGb5ZzZL</a></p>&mdash; 東京別視点ガイド (@another_tokyo) <a href="https://twitter.com/another_tokyo/status/854528752356904961">2017年4月19日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',854528752356904961);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">東京駅内の「うに屋のあまごころ」にはウニオムライス（1380円）があるよ。ウニごはんをウニ入り半熟卵でおおって、ウニで味つけしたトマトソースがかかってる代物だ！<br>シンプルにウニを楽しみたい人は板うに定食（1580円）をどうぞ～ <a href="https://t.co/gxzjYaz5RZ">pic.twitter.com/gxzjYaz5RZ</a></p>&mdash; 東京別視点ガイド (@another_tokyo) <a href="https://twitter.com/another_tokyo/status/862959316751482880">2017年5月12日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',862959316751482880);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">渋谷「汁べゑ」は通りすがりじゃ絶対いけない居酒屋だ。隠れ家バーなんてフレーズを耳にするが、ここの隠れっぷりはそんなもんじゃない。怪しい鉄の扉をくぐり、薄暗い通路を歩き、背の低いドアをくぐると、にぎやかな酒場に辿りつくよ！<a href="https://t.co/1t6chOv8fd">https://t.co/1t6chOv8fd</a> <a href="https://t.co/knLwcr5Y47">pic.twitter.com/knLwcr5Y47</a></p>&mdash; 東京別視点ガイド (@another_tokyo) <a href="https://twitter.com/another_tokyo/status/862600798513111041">2017年5月11日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',862600798513111041);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">渋谷「桜丘カフェ」はちょいと薄暗めなオシャレカフェなんだけど、テラス席のすみっこにヤギがいるよ。しばらく眺めていたら眠ってしまった。<a href="https://t.co/1t6chOdwQD">https://t.co/1t6chOdwQD</a> <a href="https://t.co/umlqQvtXPg">pic.twitter.com/umlqQvtXPg</a></p>&mdash; 東京別視点ガイド (@another_tokyo) <a href="https://twitter.com/another_tokyo/status/862268771175587844">2017年5月10日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',862268771175587844);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">池袋「Hulu-lu」<br>池袋の人気ラーメン屋さん。あっさり系のスープに鶏そぼろとカイワレがたっぷり乗っているのが特徴的(•ө•)♡ 内装はまるでハワイアンカフェ。女の子でも入りやすい雰囲気で、ラーメンというより鶏ソバ感が強かったです(•ө•)♡ <a href="https://t.co/ZL59HdNNRB">pic.twitter.com/ZL59HdNNRB</a></p>&mdash; Saki (@saki46x) <a href="https://twitter.com/saki46x/status/864065955990609920">2017年5月15日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',864065955990609920);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">渋谷「幸せのパンケーキ」<br>世界１ふわふわで、１口食べたら自然と笑顔がこぼれて幸せになってしまうというパンケーキ。パンケーキというよりスフレのような食感で、生地は甘さ控えめ。発酵バターが特徴的でした♡ +100円のホイップクリームは絶対追加するべきʕ•ᴥ•ʔ <a href="https://t.co/RKPHQXgkfL">pic.twitter.com/RKPHQXgkfL</a></p>&mdash; Saki (@saki46x) <a href="https://twitter.com/saki46x/status/863231582949171201">2017年5月13日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',863231582949171201);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">「29ON」池袋店(１・２枚目)表参道店(３・４枚目)個人的に池袋店のほうが好きでした。どっちも創作料理が凝ってて面白い♡<br>表参道店は雰囲気いいから合コンとかにはいいのかもʕ•ᴥ•ʔ <a href="https://t.co/xTiMuAS9Np">pic.twitter.com/xTiMuAS9Np</a></p>&mdash; Saki (@saki46x) <a href="https://twitter.com/saki46x/status/862975511156228098">2017年5月12日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',862975511156228098);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">六本木「豚組」<br>塩だれ、フルーツポン酢、ゴマだれ、蕎麦湯とタレがたくさんあって美味しかった(๑•🐽•๑) サイドメニューもタイプなのたくさんあった♡接客も◎ <a href="https://t.co/BxnEEWbiWj">pic.twitter.com/BxnEEWbiWj</a></p>&mdash; Saki (@saki46x) <a href="https://twitter.com/saki46x/status/862296909150420992">2017年5月10日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',862296909150420992);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">中目黒「餃子の福包」<br>ジューシーな焼き餃子と水餃子。ニラニンニクなしもあるから女の子ウケ◎<br>高菜ひき肉ご飯と、中華だしが効いたあんかけ玉子ご飯も美味しかった🍚 <a href="https://t.co/UKNhpyjjYX">pic.twitter.com/UKNhpyjjYX</a></p>&mdash; Saki (@saki46x) <a href="https://twitter.com/saki46x/status/861545156490649601">2017年5月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',861545156490649601);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">ピザの話題が出る度に何度もいいますけどね、神田、浜松町、五反田にあるデビルクラフトってお店で食べられる、シカゴピザが最高という話をですね <a href="https://t.co/s2x8NWbeLO">pic.twitter.com/s2x8NWbeLO</a></p>&mdash; 黒チル (@choco_chiruno) <a href="https://twitter.com/choco_chiruno/status/861532428082360322">2017年5月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',861532428082360322);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">ときどきしかやってないけど、池袋の「ぼうず&#39;n coffee」は本物のお寺を開放したカフェだ！<br>池袋にあるにもかかわらず京都か鎌倉かと思っちゃうような雰囲気を味わえる！<br>都会人が求めてる「癒し」がここにはあるよ！<a href="https://t.co/KM1rw4thvV">https://t.co/KM1rw4thvV</a> <a href="https://t.co/IxBGmlenA2">pic.twitter.com/IxBGmlenA2</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/859023576262860804">2017年5月1日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',859023576262860804);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">・無色透明の澄み渡ったスープ<br>・スープと麺だけのシンプルなラーメン<br><br>といえば、神楽坂の「ふくぼく」をおいて他にない。<br>昼の２時間半しか営業してないが、これまでのラーメンの概念を覆しかねない鰹と昆布ダシの優しい味のラーメンだった。<a href="https://t.co/mflPzL41Wn">https://t.co/mflPzL41Wn</a> <a href="https://t.co/8OVSZKyEFI">pic.twitter.com/8OVSZKyEFI</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/864430791887011840">2017年5月16日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',864430791887011840);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">有楽町の「ラ・メール・プラール 」の名物『スフレオムレツ』は半端じゃなくふわっふわだ！<br>中はトロトロでちょっとの振動でブルンブルン揺れる！<br>食べる前に枕に入れたくなるような一品だった。 <a href="https://t.co/9mg9UXjvjG">pic.twitter.com/9mg9UXjvjG</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/863614153952378880">2017年5月14日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',863614153952378880);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">都内を中心に店舗を広げている「肉寿司」はその名の通り肉の握り寿司の店だ！<br>今世紀のトレンドになりつつある「肉寿司」<br>赤身やさしとろはとろけるように美味い！とにかく美味い！<br>ここまで美味いのにもっと昔から流行らなかったのが不思議だ！<a href="https://t.co/DFhtuhE61m">https://t.co/DFhtuhE61m</a> <a href="https://t.co/zDw7cdTUJq">pic.twitter.com/zDw7cdTUJq</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/862877333190868992">2017年5月12日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',862877333190868992);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【カワウソ好きの天国が池袋にあった！】<br>池袋のうさぎ（カワウソ）カフェmimではうさぎだけでなくカワウソとも絡めるよ！<br>カワウソに手から餌をあげることもできてマジで萌え死ぬかと思った。 <a href="https://t.co/7WFMpNEdGx">pic.twitter.com/7WFMpNEdGx</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/856442417905508352">2017年4月24日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',856442417905508352);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">ドラえもんに登場するあの「どら焼き」にモデルがあるって知ってた？<br>新宿の「時屋」のどら焼きは藤子F不二雄先生が愛したどら焼き。<br>あまりにも好き過ぎて自身の漫画のキャラクターの好物を「どら焼き」にしてしまったんだとか…<br>ふかふかの皮の中にパンパンにあんが詰まっていて美味しいぞ。 <a href="https://t.co/tynmJXQqWa">pic.twitter.com/tynmJXQqWa</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/855052276079091713">2017年4月20日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',855052276079091713);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">ランチセットについてくるもの<br><br>・ご飯、スープお代わり無料←わかる<br>・サラダバイキング←わかる<br>・水餃子食べ放題←わからない<br><br>新宿西口の四川料理屋「天府舫」はランチセットに水餃子&amp;煮卵の食べ放題が付いてくるという謎サービス。<br>800円のランチを頼んでしこたま水餃子を食べれた。 <a href="https://t.co/fpNrHPwfkO">pic.twitter.com/fpNrHPwfkO</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/848762562317492224">2017年4月3日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',848762562317492224);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【寿司、刺身食べ放題！】<br>神田「音次郎」のランチは40分間、寿司と刺身を食べ放題で1500円だった。<br>新鮮でいろとりどりの刺身と神田の寿司職人が握った寿司を食べれたよ。<br>このクオリティでこの価格、マジでバグってる。 <a href="https://t.co/dSrC39pRZ7">pic.twitter.com/dSrC39pRZ7</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/847302608280735744">2017年3月30日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',847302608280735744);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">鶯谷の「割烹さいとう」の海鮮丼が鬼のようなコスパだった！<br>・ぶり・サーモン・エビ・マグロ・カツオ・たまご・イクラ・サザエ・タコ<br>が山のようにのせられて「1050円」って何事！？<br>それでもってこの量この値段でちゃんと美味いから驚きだ！ <a href="https://t.co/diBpQTa1Wt">pic.twitter.com/diBpQTa1Wt</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/820832808943767552">2017年1月16日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',820832808943767552);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【ラブホ寿司でその名を轟かす名店！】<br>北千住「寿司王」はラブホの建物の中にあるすし屋だ！<br>妖艶なアダルティな外観とは裏腹に一流の握りを食べられるし、もちろんお持ち帰りだってできる！<a href="https://t.co/FMX6Tp2yQu">https://t.co/FMX6Tp2yQu</a> <a href="https://t.co/IsHvgckDtq">pic.twitter.com/IsHvgckDtq</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/750463745831280640">2016年7月5日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',750463745831280640);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">新宿と池袋に店舗をかまえるステーキ食べ放題の店「300B ONE」がハンパなかった！！<br>辞書みたいに厚い牛ステーキだけじゃなく馬肉、鹿肉、羊肉そして寿司とスイーツまで食べ放題、そして食べ放題店ではありえないくらいハイクオリティだった。 <a href="https://t.co/W4HbWaKwGR">pic.twitter.com/W4HbWaKwGR</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/805308803071635456">2016年12月4日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',805308803071635456);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">渋谷にある映画BAR「八月の鯨」は映画好きなら絶対に行くべきBARだ！<br>洋画に出てきそうなバーカウンターに流れてくる音楽は映画のサントラ。カクテルのほとんどが映画をイメージしたものである！<br>……そしてなにより雰囲気が最高なのだ！<a href="https://t.co/VkBuOUh1LA">https://t.co/VkBuOUh1LA</a> <a href="https://t.co/p7aXYh9DnG">pic.twitter.com/p7aXYh9DnG</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/780315783800860672">2016年9月26日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',780315783800860672);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【こんなぷるっぷるのオムライスあったんだ…】<br>銀座「喫茶you」のオムライスがとにかく柔らかくてぷるっぷるだ！<br>ライスに乗っているタマゴはスプーンを乗せただけで割れて、食べ心地もしっとりふわふわだった！ <a href="https://t.co/N1XcuZhMDT">pic.twitter.com/N1XcuZhMDT</a></p>&mdash; へんてこグルメガイド (@asobikikaku) <a href="https://twitter.com/asobikikaku/status/761166304829067264">2016年8月4日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',761166304829067264);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">銀座にある月光荘サロン 月のはなれ。階段で5階まで登ると屋根裏っぽいオープンエアの素敵な空間が。ミュージックチャージなしで生演奏を楽しめます。画材屋さんがルーツのようで、店内は沢山の絵が飾ってあります。絵、隠れ家、テラス、生演奏あたりが好きな方に刺さると思います。 <a href="https://t.co/PmXoyGdSL5">pic.twitter.com/PmXoyGdSL5</a></p>&mdash; カズ@37歳婚活中 (@konkatsulab) <a href="https://twitter.com/konkatsulab/status/866111048943681536">2017年5月21日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',866111048943681536);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">五反田ビートル、初めて行ったけどとても良かった。大衆的な雰囲気なんだけど食べ物が文句なく美味しくて、しかもやすい <a href="https://t.co/0HTdNzCb7q">pic.twitter.com/0HTdNzCb7q</a></p>&mdash; ika (@ika_2017) <a href="https://twitter.com/ika_2017/status/866227049630810114">2017年5月21日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',866227049630810114);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">中野坂上にある町屋の&quot;再生&quot;をテーマとする建築家が作った古民家カフェ「モモガルテン」<br>ニャーお勧めカフェの1つで、休日はここで本を読むことが多いニャ <a href="https://t.co/JpQ8ahOvEm">pic.twitter.com/JpQ8ahOvEm</a></p>&mdash; ニャース (@koredemokuraei) <a href="https://twitter.com/koredemokuraei/status/790892807233953793">2016年10月25日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',790892807233953793);
insert into taglog(tag,tweet,tweetId) values ('タグログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">ニャースがお勧めするイタリアンは都営新宿線、西大島駅近くにある「クチーナ・シゲ」ニャ<br>場所が場所なだけにあまり知られていないがここの料理は全て絶品<br>なのにランチは税込1000円という破格の値段でコスパ最高ニャ<br>是非行ってみてくれニャ <a href="https://t.co/8NY4XRWU5l">pic.twitter.com/8NY4XRWU5l</a></p>&mdash; ニャース (@koredemokuraei) <a href="https://twitter.com/koredemokuraei/status/762491107028586496">2016年8月8日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',762491107028586496);
