insert into taglog(tag,tweet,tweetId) values ('稲井大輝の密会情報', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">本日の密会は「春夏秋豚 銀座」✨<br>生でも食べれる無菌豚をFカップと共に〜！ <a href="https://t.co/nnBqBv0cWv">pic.twitter.com/nnBqBv0cWv</a></p>&mdash; 稲井大輝 (@mrtodai2014_04) <a href="https://twitter.com/mrtodai2014_04/status/716641801914810369">2016年4月3日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',716641801914810369);
