insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (639715064602226688,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">女性のダイエットについて。<br>女性こそタンパク質を重視すべきです。野菜や果物も良いですが、身体を構成するのはタンパク質。肉や魚、タマゴを毎食食べるべき。パスタだけ。サラダだけ。そういう食事では美しい身体は作れないかもしれません。</p>&mdash; 久野圭一＠パーソナルトレーナー (@hisano1012) <a href="https://twitter.com/hisano1012/status/639715064602226688">2015年9月4日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',586,500,12);
