insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (864081913878691840,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">健康のために大枚を叩いて数十種類のサプリを飲んだとしても、食事はカップラーメンやジャンクフードばっかりだったり、タバコプカプカ吸ってたり、運動不足だったり、毎晩夜更かしして睡眠不足とかだったりするとサプリを摂取している意味は全く無いからね。結局、健康的な生活習慣に勝るものは無い。</p>&mdash; yuu (@yuu_alpha_male) <a href="https://twitter.com/yuu_alpha_male/status/864081913878691840">2017年5月15日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',32,7,5);
