insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (863355057995001857,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">最近また食べずに減らし始めてることに気づいて、ヤバイって気づいたのがおととい。改めて森拓郎さんの本読み返して、何か変えようとその日のうちにプロテイン注文して今日届いた。食事変えないと体変わらない。マキアもギリギリセーフで買えた💕ココアおいしい…（ ; ; ） <a href="https://t.co/hBrNX8dKFd">pic.twitter.com/hBrNX8dKFd</a></p>&mdash; モモ子 (@oloh0) <a href="https://twitter.com/oloh0/status/863355057995001857">2017年5月13日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',42,6,12);
insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (862643845707608064,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">単純に寝不足はコルチゾールレベルあげます。ストレスフルな状態は「イライラしないように」の心持ちではどうしようもないので、それをどう対処するかを考えるべき。ヨガ自体では痩せないというのは定説ですが、ヨガでメンタル面を安定させることで、結果的にやせるかもっていうことはいえますよね。</p>&mdash; 森拓郎 (@moritaku6) <a href="https://twitter.com/moritaku6/status/862643845707608064">2017年5月11日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',234,43,12);
insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (860307420274245632,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">糖質をたくさん摂った次の日なんかもそうですね。糖質1gを貯めるためには3gの水分と一緒に貯まりますから、測定上は筋肉増えたと勘違いしますが、ただ膨れているだけで、絶対量は増えていません。また、糖質制限や断食をすると始めすぐに体重が減るのはそのためです。</p>&mdash; 森拓郎 (@moritaku6) <a href="https://twitter.com/moritaku6/status/860307420274245632">2017年5月5日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',272,60,12);
insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (860295034377076736,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">標準体重がBMI22で女性の標準体脂肪率が24なら、それが分かれば標準LBMもわかります。身長×身長×22で出る体重でそれはわかりますね。22でなくとも自分の理想BMIや体脂肪率からも割り出せますが、LBMが足りてないのに食事制限している人が結構多いので注意くださいね。</p>&mdash; 森拓郎 (@moritaku6) <a href="https://twitter.com/moritaku6/status/860295034377076736">2017年5月5日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',192,44,12);
insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (860294320900849664,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">みるべきは除脂肪体重（LBM）。体脂肪を除いた、主に筋肉量の数字です。体重×（体脂肪率×0.01）で出てくる体脂肪量を体重から引けばLBMになります。これが現時点で標準以下なのに、食事制限すればするほどLBMは現象するのは明らかですよね。</p>&mdash; 森拓郎 (@moritaku6) <a href="https://twitter.com/moritaku6/status/860294320900849664">2017年5月5日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',313,57,12);
insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (860292607066292225,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">体重がBMI22以下なのに体脂肪率が30%位の人は、食事制限や有酸素で体重を落とすことより、しっかりタンパク質を摂って筋トレをして、体重を増やすつもりくらいの方が、結果的に体重がやや増えたりしながらもスタイルが良くなるという不思議現象が起こりがちです。体脂肪率が下がるからですね。</p>&mdash; 森拓郎 (@moritaku6) <a href="https://twitter.com/moritaku6/status/860292607066292225">2017年5月5日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',1168,489,12);
insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (832519445813751808,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">雑誌ダイエット企画にて、読者モデルさんが何人かいらっしゃって、ダイエットアドバイス…するも、全員BMI19以下。いやこれ体重落としてる場合ちゃいますやんってことに。みんなこの体重で「やせなきゃヤバイ」って思っている状態がヤバイことに気づいて欲しい…。</p>&mdash; 森拓郎 (@moritaku6) <a href="https://twitter.com/moritaku6/status/832519445813751808">2017年2月17日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',855,849,12);
insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (858845423594754049,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">1500kcalでタンパク質を15%にすれば56g。20%は75g大抵の女性の必要量が満たせます。さて、これは糖質多めで想定していますが、糖質55-60%でも206g-225gですからね。活動量が多くミネラルビタミンも摂れていれば、これが基本のバランスというやつになります。</p>&mdash; 森拓郎 (@moritaku6) <a href="https://twitter.com/moritaku6/status/858845423594754049">2017年5月1日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',318,64,12);
insert into beautyTweet(tweetId,tweet,favCount,rtCount,categoryId) values (857752436273946624,'<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">我慢というのは、短期だからできるもの。そもそも「◯◯したい、食べたい」を抑制すればするほど、したい食べたいの気持ちが増すわけで。我慢し続けたのにちに、どうでもよくなったという解脱を目指すより、あまり欲求がなくなるくらい別の欲求へ反らす方が楽というもの。</p>&mdash; 森拓郎 (@moritaku6) <a href="https://twitter.com/moritaku6/status/857752436273946624">2017年4月28日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',291,90,10);
