drop table if exists taglog;

create table taglog(
taglogId identity auto_increment ,
tag varchar(140) not null ,
tweet varchar(5000) not null ,
tweetId bigint not null );

drop table if exists shop;
create table shop(
shopId identity auto_increment ,
tweetId bigint not null ,
shopName varchar(300) not null ,
genre varchar(140) not null ,
location varchar(140) not null ,
tabelogUrl varchar(1000) not null );

drop table if exists beautyCategory;
create table beautyCategory(
categoryId bigint not null ,
categoryName varchar(10000) not null ,
displayNum bigint not null );

drop table if exists beautyTweet;
create table beautyTweet(
tweetId bigint not null ,
tweet varchar(10000) not null ,
favCount bigint not null ,
rtCount bigint not null ,
categoryId bigint not null );













